 import Header from './components/Header';
 import AddTimeTable from './components/AddTimeTable';
 import ListEmployee from './components/ListEmployee';
import AddEmployee from './components/AddEmployee';
 import EditEmployee from './components/EditEmployee';
import AllTimeTables from './components/alltimetables';
 import EditTimeTable from './components/EditTimeTable';


  import {
   BrowserRouter as Router,
    Routes,Route
  } from 'react-router-dom';

  export default function App () {

  return (
  <div>
  <Header/>


  <Router>
      <Routes>
  <Route exact path='/' element={<ListEmployee/>} />
  <Route path='/list' element={<ListEmployee/>} /> 
 <Route path='/addemployee' element={<AddEmployee/>} />
 <Route path='/editEmployee/:id' element={<EditEmployee/>} />
 <Route path='/get' element={<AllTimeTables/>} />
  <Route path='/edit' element={<EditTimeTable/>} />/  
  </Routes>
  </Router> 
  </div>

 )
 }
